import React from "react";
import { View, Text, Button, ActivityIndicator } from "react-native";

const Home = ({ navigation }) => {
  return (
    <View>
      <Text>Home</Text>

      <Button
        title="跳转至Count"
        onPress={() => {
          navigation.navigate("Count");
        }}
      ></Button>
    </View>
  );
};

export default Home;
